import React, { useState, useEffect } from 'react'; // Import useEffect for fetching departments
import axios from 'axios'; // for making API requests

const PatientRegistration = () => {
  const [formData, setFormData] = useState({
    name: '',
    dob: '',
    phoneNumber: '',
    email: '',
    gender: '',
    departmentId: '', // Add departmentId to form data
  });

  const [departments, setDepartments] = useState([]); // State to store department data
  const [errorMessage, setErrorMessage] = useState('');
  const [successMessage, setSuccessMessage] = useState('');

  // Function to fetch departments (on component mount or when needed)
  const fetchDepartments = async () => {
    try {
      const response = await axios.get('http://localhost:3005/departments'); // Replace with your API endpoint to fetch departments
      setDepartments(response.data);
    } catch (error) {
      console.error('Error fetching departments:', error);
      setErrorMessage('Error fetching departments. Please try again later.');
    }
  };

  useEffect(() => {
    fetchDepartments(); // Fetch departments on component mount
  }, []); // Empty dependency array ensures fetching only once

  const handleChange = (event) => {
    setFormData({ ...formData, [event.target.name]: event.target.value });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      const response = await axios.post('http://localhost:3005/register', formData); // Replace '/register' with your actual API endpoint

      setSuccessMessage('Patient registered successfully!');
      setFormData({ // Clear form after successful registration
        name: '',
        dob: '',
        phoneNumber: '',
        email: '',
        gender: '',
        departmentId: '', // Clear department selection
      });
      console.log('Patient registered successfully:', response.data); // Log successful registration response
    } catch (error) {
      console.error('Error registering patient:', error);
      setErrorMessage('Failed to register patient. Please try again.');
    }
  };

  return (
    <div>
      <h1>Patient Registration</h1>
      {errorMessage && <p className="error-message">{errorMessage}</p>}
      {successMessage && <p className="success-message">{successMessage}</p>}
      <form onSubmit={handleSubmit}>
        <label htmlFor="name">Full Name:</label>
        <input
          type="text"
          id="name"
          name="name"
          value={formData.name}
          onChange={handleChange}
          required
        />
        <br />
        <label htmlFor="dob">Date of Birth:</label>
        <input
          type="date"
          id="dob"
          name="dob"
          value={formData.dob}
          onChange={handleChange}
          required
        />
        <br />
        <label htmlFor="phoneNumber">Phone Number:</label>
        <input
          type="tel"
          id="phoneNumber"
          name="phoneNumber"
          value={formData.phoneNumber}
          onChange={handleChange}
          required
        />
        <br />
        <label htmlFor="email">Email:</label>
        <input
          type="email"
          id="email"
          name="email"
          value={formData.email}
          onChange={handleChange}
          required
        />
        <br />
        <label htmlFor="gender">Gender:</label>
        <select id="gender" name="gender" value={formData.gender} onChange={handleChange} required>
          <option value="" defaultValue>Select Gender</option>
          <option value="male">Male</option>
          <option value="female">Female</option>
          <option value="other">Other</option>
        </select>
        <br />

        {/* Department Selection */}
        <label htmlFor="departmentId">Department:</label>
        <select id="departmentId" name="departmentId" value={formData.departmentId} onChange={handleChange} required>
          <option value="" defaultValue>Select Department</option>
          {/* Dynamically populate options based on fetched departments */}
          {departments.map((department) => (
            <option key={department.id} value={department.id}>
              {department.name}
            </option>
          ))}
        </select>
        <br />

               <button type="submit">Register Patient</button>
      </form>
    </div>
  );
};

export default PatientRegistration;
